import React from 'react';
import classes from './Book.module.css';

const book = ({ id, title, catagory }) => (
  <tr className={classes.TableRow}>
    <td>{id}</td>
    <td>{title}</td>
    <td>{catagory}</td>
  </tr>
);

export default book;
